import React, { PureComponent } from 'react';

export default class PublicPraiseChartLeft extends PureComponent {
    render() {
        return (
            <div className="chart-right-whole">
				<div className="chart-area" style={{marginBottom:'6%'}}>
					<div className="chart-title">实时观众数量</div>
					<TimeNumber></TimeNumber>
				</div>
				<div className="chart-area" style={{marginBottom:'6%'}}>
					<div className="chart-title">观众数量统计</div>
					<TotalNumbers></TotalNumbers>
				</div>
				<div className="chart-area" style={{marginBottom:'6%'}}>
					<div className="chart-title">观众数量趋势分布</div>
					<NumberTrends></NumberTrends>
				</div>
				<div className="chart-area">
					<div className="chart-title">观众性年龄段统计</div>
					<SexAge></SexAge>
				</div>
			</div>
        );
    }
}
